Test: Table Border Separate

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test-specific CSS */
        .container {
            width: 400px;
            height: 300px;
            border: 2px solid #333;
            padding: 10px;
            overflow: auto;
        }
        table {
            width: 100%;
            border-collapse: separate;
            border-spacing: 15px 10px;
            border: 3px solid #333;
        }
        th, td {
            padding: 12px;
            text-align: center;
            font-size: 14px;
            border: 2px solid #666;
        }
        th {
            background-color: #e0e0e0;
            font-weight: bold;
        }
        td:nth-child(1) { background-color: #ffcccc; }
        td:nth-child(2) { background-color: #ccffcc; }
        td:nth-child(3) { background-color: #ccccff; }







